INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 190803, 1, 0.0, "2025/01/31 12:00:00", "カリン", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 62, 1000001, 1, -416.5, 3.414, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 190803, 1, 0.0, "2025/01/31 12:00:00", "カリン", "ミッションをクリアして、\n報酬をゲットしましょう！", 62, 1000002, 1, -416.5, 3.099, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 190803, 1, 0.0, "2025/01/31 12:00:00", "カリン", "受け取ることができる\n報酬があるようです\n確認してみてください", 63, 1000003, 1, -416.5, 2.801, "2030/01/01 14:59:59", 3);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 190803, 1, 0.0, "2025/01/31 12:00:00", "カリン", "報酬がもらえますよ！\nチェックしてみてください", 63, 1000004, 2, -416.5, 0.0, "2030/01/01 14:59:59", 4);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 190803, 1, 0.0, "2025/01/31 12:00:00", "カリン", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 64, 1000005, 2, -363.0, 2.12, "2030/01/01 14:59:59", 5);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 190803, 1, 0.0, "2025/01/31 12:00:00", "カリン", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 64, 1000006, 1, -363.0, 1.68, "2030/01/01 14:59:59", 6);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 190803, 1, 0.0, "2025/01/31 12:00:00", "カリン", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 64, 1000007, 2, -363.0, 2.33, "2030/01/01 14:59:59", 7);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (7, 133701, 10201, -6.0, "2025/01/31 12:00:00", "ラビリスタ", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 61, 1020101, 3, -285.0, 5.18, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 133901, 10201, -2.0, "2025/01/31 12:00:00", "クリスティーナ", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 61, 1020102, 1, -285.0, 8.77, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 133801, 10201, 0.0, "2025/01/31 12:00:00", "ネネカ", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 61, 1020103, 6, -285.0, 15.5, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (5, 134301, 10202, 0.0, "2025/02/28 12:00:00", "ランファ", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 61, 1020201, 2, -285.0, 9.061, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 134401, 10202, 0.0, "2025/02/28 12:00:00", "チカ", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 61, 1020202, 1, -285.0, 7.699, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 134601, 10203, 0.0, "2025/03/31 12:00:00", "アオイ", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 61, 1020301, 1, -285.0, 8.595, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 134501, 10203, 0.0, "2025/03/31 12:00:00", "クローチェ", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 61, 1020302, 1, -285.0, 7.758, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (6, 132302, 10204, 0.0, "2025/04/30 12:00:00", "ルイズマリー", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 61, 1020401, 2, -285.0, 7.0, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 132402, 10204, 0.0, "2025/04/30 12:00:00", "イロハ", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 61, 1020402, 1, -285.0, 7.904, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 132502, 10204, 0.0, "2025/04/30 12:00:00", "ソノ", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 61, 1020403, 4, -285.0, 8.487, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 134901, 10205, 0.0, "2025/05/31 12:00:00", "カノン", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 61, 1020502, 1, -285.0, 8.763, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3, 134801, 10205, 0.0, "2025/05/31 12:00:00", "ツムギ", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 61, 1020503, 1, -285.0, 6.417, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (7, 135001, 10206, 0.0, "2025/06/30 12:00:00", "エリス", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 61, 1020601, 3, -285.0, 10.335, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (4, 135101, 10206, 0.0, "2025/06/30 12:00:00", "シェフィ", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 61, 1020602, 2, -285.0, 6.281, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 135201, 10206, 0.0, "2025/06/30 12:00:00", "プレシア", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 61, 1020603, 1, -285.0, 12.244, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8, 135301, 10207, 0.0, "2025/07/31 12:00:00", "クリア", "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 61, 1020701, 2, -285.0, 6.339, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (9, 135401, 10207, 0.0, "2025/07/31 12:00:00", "アネモネ", "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 61, 1020702, 7, -285.0, 8.184, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 129101, 10208, 0.0, "2025/08/31 12:00:00", "アイラ", "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 61, 1020801, 9, -285.0, 3.906, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 129201, 10208, 0.0, "2025/08/31 12:00:00", "シナツ", "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 61, 1020802, 1, -285.0, 14.465, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3, 100101, 10208, 0.0, "2025/08/31 12:00:00", "ヒヨリ", "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 61, 1020803, 4, -285.0, 8.662, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3, 100301, 10208, 0.0, "2025/08/31 12:00:00", "レイ", "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 61, 1020804, 1, -285.0, 10.915, "2030/01/01 14:59:59", 401);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (7, 135802, 10209, 0.0, "2025/09/30 12:00:00", "ユキノ", "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 61, 1020901, 1, -285.0, 6.042, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 135903, 10209, 0.0, "2025/09/30 12:00:00", "サツキ", "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 61, 1020902, 4, -285.0, 9.402, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 136902, 10209, 0.0, "2025/09/30 12:00:00", "ルルィ", "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 61, 1020903, 8, -285.0, 8.16, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 137401, 10210, 0.0, "2025/10/31 12:00:00", "カスミ", "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 61, 1021001, 3, -285.0, 5.0, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 136001, 10210, 0.0, "2025/10/31 12:00:00", "アラクネ", "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 61, 1021002, 4, -285.0, 8.12, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 136202, 10210, 0.0, "2025/10/31 12:00:00", "ナーナ", "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 61, 1021003, 4, -285.0, 6.386, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (4, 136402, 10211, 0.0, "2025/11/30 12:00:00", "ユイ", "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 61, 1021101, 3, -285.0, 7.438, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (5, 136302, 10211, 0.0, "2025/11/30 12:00:00", "ミソラ", "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 61, 1021102, 1, -285.0, 8.35, "2030/01/01 14:59:59", 201);
